import React from "react";
const { default: src } = require("*.bmp");

const SlideFacts=({item})=>
    {
        return
            (
                <div className="facts-slide">
                    <img src={item.imgUrl} alt = "slaide image"/>
            <p className="facts-slide-desc">{item.desc}</p>

                </div>
            );
    };

    export default SlideFacts;
